import React from 'react';
import { Link } from 'react-router-dom';
import '../stylesheets/Taskbar.css';
import logo from '../img/logo.png';

function Taskbar() {
  return (
    <div className="taskbar">
      <Link to="/">
        <img src={logo} alt="SadLogo" className="logo-image taskbar-item" />
      </Link>
      <Link to="/about" className="taskbar-button active taskbar-item">About</Link>
      <Link to="/resume" className="taskbar-button taskbar-item">Resume</Link>
      <Link to="/academics" className="taskbar-button taskbar-item">Academics</Link>
      <Link to="/articles" className="taskbar-button taskbar-item">Articles</Link>
      <Link to="/wiki" className="taskbar-button taskbar-item">Wiki</Link>
    </div>
  );
}

export default Taskbar;
